export const getCitiesByPopulation = (population = 100000): City[] => cities
    .filter(c => c.population > population)
    .sort((a, b) => b.population - a.population);

export const getCountries = (countries: string[], population = 100000): Country[] => getCitiesByPopulation(population)
    .filter(c => countries.findIndex(s => s === c.country) > -1)
    .map(c => ({ name: c.country }))
    .filter((v, i, a) => a.findIndex(c => c.name === v.name) === i);

export const getCitiesByCountry = (countries: string[], population = 100000): City[] => getCitiesByPopulation(population)
    .filter(c => c.population > population)
    .filter(c => countries.findIndex(s => s === c.country) > -1);

export interface Country {
    name: string;
}

export interface Region {
    name: string;
    country: string;
}

export interface City {
    id: number;
    name: string;
    country: string;
    region: string;
    population: number;
}
